import React from 'react';

function DiscussionPage() {
    return (
        <div className="container mt-4">
            <h1>Latest Discussions</h1>
            <ul className="list-group">
                <li className="list-group-item">Discussion 1: Best practices for unit testing</li>
                <li className="list-group-item">Discussion 2: Tips for optimizing SQL queries</li>
                <li className="list-group-item">Discussion 3: Frontend frameworks comparison</li>
            </ul>
        </div>
    );
}

export default DiscussionPage;
